import "./App.css";
import "./styles/LoginPage.css";
import "./styles/nav.css";
import "./styles/userDetails.css";
import "./styles/lessons.css";
import "./styles/searchTeacher.css";
import "./styles/calendar.css";
import "./styles/alert.css";

import React from "react";
import { Routes, Route } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import Login from "./components/AccountManagement/login";
import StudentPage from "./components/Student/StudentPage";
import TeacherPage from "./components/Teacher/TeacherPage";
import ChoseType from "./components/choseType";
import { WebSocketProvider } from "../src/components/WebSocketContext";

function App() {
  const navigate = useNavigate();
  useEffect(() => {
    navigate("/login");
  }, []);

  return (
    <WebSocketProvider>
      <Routes>
        <Route path="/" element={<Login />}></Route>
        <Route path="/login" element={<Login />} />
        <Route path="/choseAccount/:userid" element={<ChoseType />} />
        <Route path="/teacher/:userid" element={<TeacherPage />} />
        <Route path="/student/:userid" element={<StudentPage />} />
      </Routes>
    </WebSocketProvider>
  );
}
export default App;
